class Solution:
    def gcd(self,a,b):
        if(a==0):
            return b
        return self.gcd(a%b,a)

    def hasGroupsSizeX(self, deck):
        dictt = {}
        for i in deck:
            if(i not in dictt):
                dictt[i]=1
            else:
                dictt[i]+=1
        listt = list(dictt.values())
        print(listt)
        result = listt[0]
        for i in range(0,len(listt)-1):
            result = self.gcd(listt[i],listt[i+1])
            if(result==1):
                return False
        if(result==1):
            return False
        return True







